const appRouter = createBrowserRouter([
  {
    path: "/",
    element: <Login />,
    errorElement: <Error />,
  },
  {
    path: "/LoginSignIn",
    element: <LoginSignIn />,
  },
  {
        path: "/",
        element: <App />,
        children: [
          {
            path: "/App",
            element: <Protected Component={Body} />,
          },
          {
            path: "/About",
            element: <Protected Component={About} />,
          },
          {
            path: "/Contact",
            element: <Contact />,
          },
          {
            path: "/restaurant",
            element: <Body />,
          },
          {
            path: "/Cart",
            element: <Cart />,
          },
          // dynamic routing to open menu page for each restaurant
          {
            path: "/restaurant/:id",
            element: <Menu />,
          },
        ],
        errorElement: <Error />,
      },
]);

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <RouterProvider router={appRouter} />
  </React.StrictMode>
);

